import { Box } from '@material-ui/core';
import axios from 'axios';
import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';
import './App.css';
import { FilmCard } from './components/filmCard';

function App() {

  const [data, setData] = useState<Array<Record<string, unknown>>>([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios(
        'https://api.themoviedb.org/3/discover/tv?api_key=92b418e837b833be308bbfb1fb2aca1e&language=fr-FR&sort_by=popularity.desc&page=1&timezone=America/New_York&include_null_first_air_dates=false',
      );
      setData(result.data.results);
    }
    fetchData();
  },[])

  console.log('%cApp.tsx line:25 data', 'color: #007acc;', data);

  return (
    <Box className="App">
      <header className="App-header">
        <h1>Mon header</h1>
      </header>
      <section>
        <h1>Ma section</h1>
        {/* <ul>
          {data.map(item => (
            <li key={item.id}>
              <p>{item.name}</p>
            </li>
          ))}
        </ul> */}
        <FilmCard textOverview="Ce film est lourd" image="https://image.tmdb.org/t/p/original//wr7nrzDrpGCEgYnw15jyAB59PtZ.jpg"/>
        <img src="https://image.tmdb.org/t/p/original//wr7nrzDrpGCEgYnw15jyAB59PtZ.jpg" height="100px" width="100px"/>
      </section>
    </Box>
  );
}

export default App;
